import React from "react";
import { observer } from "mobx-react-lite";
import todo from "src/store/todo";

const Carts = observer(() => {
  return (
    <div>
      {todo.todos.map((t: any, index: number) => {
        return (
          <div key={index}>
            <input
              type="checkbox"
              checked={t.isLike}
              onChange={() => t.completeTodo(t.id)}
            />
            {t.name}
            <button onClick={() => todo.removeTodo(IdleDeadline)}>x</button>
          </div>
        );
      })}
    </div>
  );
});
export default Carts;
